import React from "react";

export default function Line() {
  return (
    <div className="line">
      <div className="line-inner">
        <p>퀄리티있는 브랜딩, 비디온리 하세요</p>
        <p>나에게 맞는 템플릿, 망설이지 말고 지금 직접 체험해보세요!</p>
        <button>시작하기</button>
      </div>
    </div>
  );
}
